import React, { useState  , useEffect} from "react";
import classes from "./styles/Projects.module.css";
import './styles/cards.css';
import Target_icon from '../assets/target_icon.png';
import invisble from '../assets/invisible.png';

const Wheel = ({card}) => {
  const[state , setState] = useState(false);
  console.log(state)
  console.log(card)
  const dummy = card;

    useEffect(()=>{
      setInterval((()=>{
        var targetIconTag1 = document.getElementById('target_iconP1');   
        var targetIconTag2 = document.getElementById('target_iconP2');
        var targetIconTag3 = document.getElementById('target_iconP3');
        var targetIconTag4 = document.getElementById('target_iconP4');
        if(targetIconTag1.getAttribute('src')  === Target_icon){
           targetIconTag1.setAttribute('src',invisble);
           targetIconTag2.setAttribute('src',Target_icon);
        }else if(targetIconTag2.getAttribute('src')  === Target_icon){
          targetIconTag2.setAttribute('src',invisble);
          targetIconTag3.setAttribute('src',Target_icon);
       }else if(targetIconTag3.getAttribute('src')  === Target_icon){
        targetIconTag3.setAttribute('src',invisble);
        targetIconTag4.setAttribute('src',Target_icon);
       }else if(targetIconTag4.getAttribute('src')  === Target_icon){
        targetIconTag4.setAttribute('src',invisble);
        targetIconTag1.setAttribute('src',Target_icon);
       } 

        const temp = dummy[0];
        dummy.shift();
        dummy.push(temp);
        setState((prevstate) => !prevstate)
      }),2000);

    },[dummy])

  return (
    <>
    <div className={classes.wheels} id="project"></div>
    <a href="/" className={classes.btn}>Projects</a>
     { dummy[0] &&<> <div className={classes.cards} id="card1">
     <img src={invisble} alt="active card" id="target_iconP1"></img>
     {dummy[0].project_logo ? <img src={ `http://localhost/${dummy[0].project_logo}` } className={classes.ProjectImage}  alt={dummy[0].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[0].name.charAt(0) }</p>
     }

        {/* <p id="c_title1">{dummy[0].name}</p>  */}
        {console.log(dummy[0])}
      </div>
      <div className={classes.cards} id="card2" >
      <img src={Target_icon} alt="active card" id="target_iconP2"></img>
      {dummy[1].project_logo ? <img src={ `http://localhost/${dummy[1].project_logo}` } className={classes.ProjectImage}  alt={dummy[1].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[1].name.charAt(0) }</p>
     }
      </div>
      <div className={classes.cards} id="card3">
      <img src={invisble} alt="active card" id="target_iconP3"></img>
      {dummy[2].project_logo ? <img src={ `http://localhost/${dummy[2].project_logo}` } className={classes.ProjectImage}  alt={dummy[2].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[2].name.charAt(0) }</p>
     }
      </div>
      <div className={classes.cards} id="card4">
      <img src={invisble} alt="active card" id="target_iconP4"></img>
      {dummy[3].project_logo ? <img src={ `http://localhost/${dummy[3].project_logo}` } className={classes.ProjectImage}  alt={dummy[3].name} ></img> :
     <p className={classes.ProjectCustomLogo}>{dummy[3].name.charAt(0) }</p>
     }
      </div></>}


    </>
  );
};

export default Wheel;
